import React from "react";

function Main(props) {
  console.log(props.location.state);
  return (
    <div className="container">
    <div className="row">
        <div className="col-md-4 col-sm-12"></div>
    </div>
      <h1>hi {props.location.state.givenName}</h1>
      <img src={props.location.state.imageUrl} />
    </div>
  );
}

export default Main;
